import React from 'react';
import './App.css';
import Login from './component/login';
import  lib from "./view/liblist";
import Dashboard from "./view/libcreate";
import About from "./view/requestforadminorreader";


import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route
            exact
            path="/liblist"
            element={
              <div>
                <Header />
                <Home />
              </div>
            }
          />
          <Route
            exact
            path="/dashboard"
            element={
              <div>
                <Header />
                <Dashboard />
              </div>
            }
          />
          <Route
            exact
            path="/projects"
            element={
              <div>
                <Header />
                <Project />
              </div>
            }
          />
          <Route
            exact
            path="/about"
            element={
              <div>
                <Header />
                <About />
              </div>
            }
          />
        </Routes>
      </div>
    </Router>


    // <Login />
  );
}

export default App;
